import React from "react";
import mc from "./buttons.module.scss";

const Buttons = (props) => {
  const { btnHome } = props;
  return (
    <div>
      <button className={`${mc.login} ${btnHome}`}>Log In</button>
      <button className={`${mc.signUp} ${btnHome}`}>Sign Up</button>
    </div>
  );
};

export default Buttons;
